	 (1,'Poole Harbour','Cette spacieuse propriété contemporaine à Poole Dorset a tout ce dont votre famille et vos amis ont besoin pour un excellent séjour,peut accueillir 12 personnes, un emplacement idéal pour les villes et la vue, la plage et le parc de l''autre côté de la route,
